class Node:    def __init__(self, data_in):        self.data = data_in        self.left = None        self.right = Noneclass Tree:    def __init__(self):        self.left = None        self.right = None        self.root = None    def il(self, data, place):        new_node = Tree(data)        if self.left is None:            self.left = new_node        elif self.left.data == place:            if self.left is None:                self.left = new_node                return            else:                self.left.il(data, place)                self.right.il(data, place)        else:            print("Cannot find the root: " + str(place) + ".")    def ir(self, data, place):        new_node = Tree(data)        if self.right is None:            self.right = new_node        elif self.right.data == place:            if self.right is None:                self.right = new_node                return            else:                self.left.ir(data, place)                self.right.ir(data, place)        else:            print("Cannot fine the root: " + str(place) + ".")    def insert(self, data_in):        if self.root in None:            self.root = Node(data_in)        else:            pass    def insert_help(self):        pass    def pre_order(self):        print(self.data)        if self.left:            self.left.pre_order()        if self.right:            self.right.pre_order()    def in_order(self):        if self.left:            self.left.in_order()        print(self.data)        if self.right:            self.right.in_order()    def post_order(self):        if self.left:            self.left.post_order()        if self.right:            self.right.post_order()        print(self.data)t = Tree("a")t.il("b", "a")t.ir("c", "a")t.ir("d", "b")# t.il("e", "c")# t.il("f", "e")print("\npre")t.pre_order()print("\nin")t.in_order()print("\npost")t.post_order()